from utils import read_arr


def quick_sort(arr, l, r):
    if r-l < 2:
        return 0
    pivot = l
    j = r
    i = pivot+1
    while i < j:
        while arr[i] < arr[pivot] and i < r:
            i += 1
        while arr[j] > arr[pivot] and j > pivot:
            j -= 1
        if (i < j):
            swap(arr, i, j)

    swap(arr, pivot, j)
    quick_sort(arr, l, j)
    quick_sort(arr, j+1, r)


def swap(arr, i, j):
    tmp = arr[i]
    arr[i] = arr[j]
    arr[j] = tmp


a = read_arr()
quick_sort(a, 0, len(a)-1)
print("sorted: ", a)
